import NavBar from '../components/NavBar'
import 'bulma/css/bulma.css'

class HomePage extends Component {
    render() {
        return (
            <React.Fragment>
        <div><NavBar/></div>
        <div className="background-home"></div>
        </React.Fragment>

        );
    }
}

export default HomePage;
